import React, { useState } from 'react'

import axios from 'axios'

import { Redirect } from 'react-router-dom'

import Arrow002 from '../icons/arrows/Arrow002'

import './css/RoundedButton.scss'

const RoundedButton = (props) => {
    const [submitted, setSubmitted] = useState(false)

    const test = props.redirect_BOOLEAN

    const handleSubmit = (event) => {
        if(props.redirect_BOOLEAN === 'true') {
            console.log("L'utilisateur a était soumis ")

            event.preventDefault()
            axios.get('http://localhost:8080/vhe/vhes_list/').then(result => {
            /* axios.get('http://10.0.4.5:8000/vhe/vhe/').then(result => { */
                console.log(result)
                const response = result.data
                setSubmitted(true)
            }).catch(e => {
                console.log('Error getting data: ' + e)
            })
        }
    }

    if (submitted) {
        return (
            <>
                <Redirect push to={{
                    pathname: '/search_result',
                    state: {}
                }}/>
            </>
        )
    }

    return (
        <>
            <button
                type='button'
                id={props.button_ID}
                className={props.button_CLASSNAME}
                onClick={handleSubmit}
            >
                <span className={props.span_text_CLASSNAME}>
                    {props.button_TEXT}
                    {props.redirect_BOOLEAN}
                </span>
                <Arrow002
                    display={props.Arrow002}
                />
            </button>
        </>
    )
}

export default RoundedButton
